import {describe, expect, it} from "vitest";
import {parsePdf} from "../../../src/common/helpers/pdfParser.helper";

describe("parsePdf", () => {
    it("should parse pdf to text", async () => {
        const base64 = '';
        const pdfBuffer = new Uint8Array(Buffer.from(base64, 'base64'));
        const result = await parsePdf(pdfBuffer);

        console.log(JSON.stringify(result, null, 2));

        expect(result).not.null;
        expect(result.metadata).not.null;
        expect(result.pages).not.null;
    });
});